import React from 'react';
import Head from 'next/head';
import OtherLayout from '../components/OtherLayout';

const Contact = () => (
  <>
    <Head>
      <title>Study Board | Contact </title>
    </Head>
    <OtherLayout>
      <div>Contact </div>
    </OtherLayout>
  </>
);

export default Contact;
